object.script:
nosegear=0 nosedoor=0
function onTick() nosehinge = input.getNumber(1) lefthinge = input.getNumber(2) righthinge = input.getNumber(3) leftdoorhinge = input.getNumber(4) rightdoorhinge = input.getNumber(5) down = input.getBool(1)
if 0.01<math.abs(leftdoorhinge+rightdoorhinge) and math.abs(leftdoorhinge+rightdoorhinge)<0.49 then nosedoorsmoveing = true else nosedoorsmoveing = false end
if down then nosegear=1 nosedoor=0 if math.abs(leftdoorhinge+rightdoorhinge)<0.05 then nosegear = 0 end else nosegear=1 nosedoor=0 if math.abs(nosehinge-0.25)<0.05 then nosedoor = 1 end end
output.setNumber(1,nosegear) output.setNumber(2,nosedoor)
end
function onDraw() w = screen.getWidth() h = screen.getHeight()
screen.setColor(0,0,0) screen.drawClear()
if math.abs(nosehinge)<0.01 and not nosedoorsmoveing then screen.setColor(0,255,0) elseif math.abs(0.25-nosehinge)<0.01 and not nosedoorsmoveing then screen.setColor(10,10,10) else screen.setColor(255,0,0) end screen.drawCircleF(w/2, h/3, 3)
if math.abs(lefthinge)<0.01 then screen.setColor(0,255,0) elseif math.abs(0.25-lefthinge)<0.01 then screen.setColor(10,10,10) else screen.setColor(255,0,0) end screen.drawCircleF(w/3, h/3*2, 3)
if math.abs(righthinge)<0.01 then screen.setColor(0,255,0) elseif math.abs(0.25-righthinge)<0.01 then screen.setColor(10,10,10) else screen.setColor(255,0,0) end screen.drawCircleF(w/3*2, h/3*2, 3)
end
